import React from 'react';
import { LoadScript } from '@react-google-maps/api';
import Lista from "./Lista";

function Alumnos() {
  return (
    <div className="App">
      <LoadScript googleMapsApiKey="AIzaSyA2FiornoQX5U96lGPgQFGV_Qnioqyl8vA">
        <Lista />
      </LoadScript>
    </div>
  );
}

export default Alumnos;
